import styled from 'styled-components';


export const ResumeContainer = styled.div ` 
   background-color: #ddd8ff;
`

export const ResumeWrapper = styled.div `
    display: grid;
    margin-top: 100px;
    margin-bottom: 20px;
    margin-left: auto;
    margin-right: auto;
    color: black;
    background: white;
    box-shadow: 0 5px 5px 0 rgba(0,0,0,0.14), 0 1px 5px 0 rgba(0,0,0,0.12), 0 3px 1px -2px rgba(0,0,0,0.2);
    height: 85vh;
    padding: 30px;
    width: 60vw;
    max-width: 20cm;
    max-height: 29.7cm;

@media screen and (max-width: 768px) {
    padding: 15px;
}
`

export const ResumeContact = styled.div `
    text-align: center;
    justify-content: center;
    grid-template-columns: [col-1-start] 1fr;
    grid-template-rows: [row-1-start] 1fr;
`

export const ResumeBio = styled.div `
    text-align: center;
    grid-template-rows: [row-2-start] 1fr;
`

export const newLine = styled.div`
    white-space: pre-line;
`

export const WorkExperienceTitle = styled.div `
    text-align: left;
    justify-content: left;

`

export const WorkExperience = styled.div `
    text-align: center;
    grid-template-rows: [row-2-start] 1fr;
`
